static void pack_32_1bit_u32_words(uint32_t *restrict dst, const uint32_t *restrict src)
{
	uint32_t x;
	x = src[0];
	x |= src[1] << 1;
	x |= src[2] << 2;
	x |= src[3] << 3;
	x |= src[4] << 4;
	x |= src[5] << 5;
	x |= src[6] << 6;
	x |= src[7] << 7;
	x |= src[8] << 8;
	x |= src[9] << 9;
	x |= src[10] << 10;
	x |= src[11] << 11;
	x |= src[12] << 12;
	x |= src[13] << 13;
	x |= src[14] << 14;
	x |= src[15] << 15;
	x |= src[16] << 16;
	x |= src[17] << 17;
	x |= src[18] << 18;
	x |= src[19] << 19;
	x |= src[20] << 20;
	x |= src[21] << 21;
	x |= src[22] << 22;
	x |= src[23] << 23;
	x |= src[24] << 24;
	x |= src[25] << 25;
	x |= src[26] << 26;
	x |= src[27] << 27;
	x |= src[28] << 28;
	x |= src[29] << 29;
	x |= src[30] << 30;
	x |= src[31] << 31;
	dst[0] = x;
}

